class Solution:
    def findSubstring2(self, s: str, words: [str]) -> [int]:
        if not s or len(words) == 0:
            return []
        wordCount = len(words)        
        wordLen = len(words[0])
        expectedLen = wordCount * wordLen 
        result = set()
        for i in range(len(s)):
            notMatch = set()
            if i > len(s) - expectedLen:
                break
            for j in range(len(words)):
                if words[j] in notMatch:
                    continue
                if self.match(j, s[i:], words):
                    result.add(i)
                else:
                    notMatch.add(words[j])
                    

        return list(result)
    
    def match(self, wordIndex:int, s:str, restWords:[str]) -> bool:
        word = restWords[wordIndex]
        wordLen = len(word)

        if word == s[:wordLen]:
            if len(restWords) == 1:
                return True
            else:
                notMatch = set()
                rrWords = restWords.copy()
                del rrWords[wordIndex]
                for i in range(len(rrWords)):
                    if rrWords[i] in notMatch:
                        print("notmatch")
                        continue 
                    result = self.match(i, s[wordLen:], rrWords)
                    if result:
                        return True
                    else:
                        notMatch.add(rrWords[i])
                
                return False
        else:
            return False

    def findSubstring(self, s: str, words: [str]) -> [int]:
        if not s or len(words) == 0:
            return []
        wordCount = len(words)        
        wordLen = len(words[0])
        expectedLen = wordCount * wordLen 
        result = []
        for i in range(len(s)):
            if i > len(s) - expectedLen:
                break

            cwords = {}
            for word in words:
                if word in cwords:
                    cwords[word] += 1
                else:
                    cwords[word] = 1

            for j in range(0, len(s), wordLen):
                # print('before cwords', cwords)
                if len(s) - i - j < len(cwords) * wordLen:
                    # print('length break')
                    break
                # print(s[i+j:i+j+wordLen])
                word = s[i + j:i+j+wordLen] 
                if word in cwords:
                    if cwords[word] == 1:
                        del cwords[word]
                    else:
                        cwords[word] -= 1
                else:
                    break
                # print('after cwords', cwords)
             
            if len(cwords) == 0:
                result.append(i)
                    

        return result
 
